function backGroundTest(data) {
    const grass = "https://staticg.sportskeeda.com/editor/2021/04/9fe81-16173036977561-800.jpg"
    if (data.types[0].type.name === "grass") {
        return document.body.style.background = `url(${grass})`
    }
}
export default backGroundTest;
